import request from '@/utils/request';
import { cxt } from '@/utils/constant';
export function doCacheImage(filepath, number) {
  return request({
    url: cxt + '/op/server/pdf/image/cache/' + filepath + '/' + number,
    method: 'get'
  });
}
export function doSaveBook(data) {
  return request({
    url: cxt + '/book',
    method: 'post',
    data: data
  });
}
